        <div className={classes.root}>
        {/* <Countdown date={'2020-09-05T09:00:00'} text='Ki Tavo Bar Mitzva Countdown'  /> */}

          <Route
            path="/"
            render={({ location }) => (
              <Fragment variant="dense" >

            <div class="scrolling-wrapper">
               <div class="card">
                   <h2>
                   Welcome
                   <Link to="/Practice">
                       <img src="./images/barmit.png" alt="icon" loading="lazy" width="504" height='auto'/>
                   </Link>
                   </h2>
               </div>
               <div class="card">
                   <h2>
                   How I Work
                   <Link to="/Fresh">
                       <img src="./images/barmit.png" alt="icon" loading="lazy" width="504" height='auto'/>
                   </Link>
                   </h2>
               </div>
               <div class="card">
                   <h2>
                   About Me
                   <Link to="/Fresh">
                       <img src="./images/barmit.png" alt="icon" loading="lazy" width="504" height='auto'/>
                   </Link>
                   </h2>
               </div>
               <div class="card">
                   <h2>
                   Contact Me
                   <Link to="/Tropes">
                       <img src="./images/barmit.png" alt="icon" loading="lazy" width="504" height='auto'/>
                   </Link>
                   </h2>
               </div>
